import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import ParticlesBg from 'particles-bg';
import Particles from 'react-particles-js';

ReactDOM.render(
  <React.StrictMode>
      <div>
     /* <ParticlesBg color="#064663" num={200} type="cobweb" bg={true} />*/
          <Particles
        params={{
          particles: {
            number: {
              value: 200,
              density: {
                enable: true,
                value_area: 1000,
              }
            },
          },
        }}
      />
      <App />
      </div>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
